[{"location":"examples.html","page":"Examples","title":"Examples","text":"CurrentModule = BayesianSVD","category":"page"},{"location":"examples.html#Examples","page":"Examples","title":"Examples","text":"","category":"section"},{"location":"examples.html","page":"Examples","title":"Examples","text":"Examples for BayesianSVD.","category":"page"},{"location":"examples.html","page":"Examples","title":"Examples","text":"","category":"page"},{"location":"examples.html","page":"Examples","title":"Examples","text":"Modules = [BayesianSVD]","category":"page"},{"location":"examples.html#BayesianSVD.BayesianSVD","page":"Examples","title":"BayesianSVD.BayesianSVD","text":"BayesianSVD\n\nHere is my package.\n\n\n\n\n\n","category":"module"},{"location":"examples.html#BayesianSVD.Data-Tuple{Any, IdentityKernel, IdentityKernel, Any}","page":"Examples","title":"BayesianSVD.Data","text":"Data(Y, ΩU::KernelFunction, ΩV::KernelFunction, k)\n\nCreates the data class.\n\nSee also Pars, Posterior, and SampleSVD.\n\nArguments\n\nY: data of dimension n × m\nΩU::KernelFunction: Kernel for U matrix, of dimension n × n\nΩV::KernelFunction: Kernel for V matrix, of dimension m × m\nk: number of basis functions to keep\n\nTo Do\n\nallow for ΩU and ΩV to be of different types (i.e., ΩU is Matern and ΩV is Identity)\n\nExamples\n\nTo Do.\n\n\n\n\n\n","category":"method"},{"location":"examples.html#BayesianSVD.Pars-Tuple{BayesianSVD.IdentityData}","page":"Examples","title":"BayesianSVD.Pars","text":"Pars(data::Data)\n\nCreates the parameter class of type typeof(data).'\n\nSee also Data, Posterior, and SampleSVD.\n\nArguments\n\ndata: data structure of type Data\n\nExamples\n\nTo Do.\n\n\n\n\n\n","category":"method"},{"location":"examples.html#BayesianSVD.Posterior","page":"Examples","title":"BayesianSVD.Posterior","text":"Posterior\n\nStructure of type posterior with subtypes Identity, Exponential, Gaussian, or Matern. Contains the raw posterior samples and some means and 95% quantiles of parameters. Plotting associated with the structure.\n\nSee also Pars, Data, and SampleSVD.\n\nExamples\n\n\nRandom.seed!(2)\n\nm = 100\nn = 100\nx = range(-5, 5, n)\nt = range(0, 10, m)\n\nΣU = MaternKernel(x, ρ = 3, ν = 4, metric = Euclidean())\nΣV = MaternKernel(t, ρ = 3, ν = 4, metric = Euclidean())\n\nk = 5\nΦ = PON(n, k, ΣU.K)\nΨ = PON(n, k, ΣV.K)\n\nD = diagm([40, 20, 10, 5, 2])\n\nϵ = rand(Normal(0, sqrt(0.01)), n, m)\nY = Φ * D * Ψ' + ϵ # n × m\n\n\nΩU = MaternKernel(x, ρ = 4, ν = 4, metric = Distances.Euclidean())\nΩV = MaternKernel(t, ρ = 4, ν = 4, metric = Distances.Euclidean())\ndata = Data(Y, ΩU, ΩV, k)\npars = Pars(data)\n\nposterior, pars = SampleSVD(data, pars; nits = 1000, burnin = 500, show_progress = true)\n\nplot(posterior, x, size = (900, 600), basis = 'U', linewidth = 2, c = [:red :green :purple])\nplot(posterior, t, size = (900, 500), basis = 'V', linewidth = 2, c = [:red :green :purple])\n\n# for spatial basis functions, provide x and y\nplot(posterior, x, y)\n\n\n\n\n\n","category":"type"},{"location":"examples.html#BayesianSVD.PON-Tuple{Any, Any, Any}","page":"Examples","title":"BayesianSVD.PON","text":"PON(n, k, Sigma)\n\nCreate an n by k orthonormal matrix with covariance matrix Sigma.\n\nArguments\n\nn: Number of locations \nk: Number of basis functions\nSigma: covariance matrix\n\nExamples\n\nm = 100\nn = 100\nx = range(-5, 5, n)\nt = range(0, 10, m)\n\nΣU = MaternKernel(x, ρ = 3, ν = 4, metric = Euclidean())\nΣV = MaternKernel(t, ρ = 3, ν = 4, metric = Euclidean())\n\nk = 5\nΦ = PON(n, k, ΣU.K)\nΨ = PON(n, k, ΣV.K)\n\n\n\n\n\n","category":"method"},{"location":"examples.html#BayesianSVD.SampleSVD-Tuple{BayesianSVD.IdentityData, BayesianSVD.IdentityPars}","page":"Examples","title":"BayesianSVD.SampleSVD","text":"SampleSVD(data::Data, pars::Pars; nits = 10000, burnin = 5000, show_progress = true)\n\nRuns the MCMC sampler for the Bayesian SVD model.\n\nSee also Pars, Data, and Posterior.\n\nArguments\n\ndata: Data structure of type Identity, Exponential, Gaussian, or Matern\npars: Parameter structure of type Identity, Exponential, Gaussian, or Matern\n\nOptional Arguments\n\nnits = 10000: Total number of posterior samples to compute\nburnin = 5000: Number of samples discarded as burnin\nshow_progress = true: Indicator on whether to show a progress bar (true) or not (false).\n\nExamples\n\n\nRandom.seed!(2)\n\nm = 100\nn = 100\nx = range(-5, 5, n)\nt = range(0, 10, m)\n\nΣU = MaternKernel(x, ρ = 3, ν = 4, metric = Euclidean())\nΣV = MaternKernel(t, ρ = 3, ν = 4, metric = Euclidean())\n\nk = 5\nΦ = PON(n, k, ΣU.K)\nΨ = PON(n, k, ΣV.K)\n\nD = diagm([40, 20, 10, 5, 2])\n\nϵ = rand(Normal(0, sqrt(0.01)), n, m)\nY = Φ * D * Ψ' + ϵ # n × m\n\n\nΩU = MaternKernel(x, ρ = 4, ν = 4, metric = Distances.Euclidean())\nΩV = MaternKernel(t, ρ = 4, ν = 4, metric = Distances.Euclidean())\ndata = Data(Y, ΩU, ΩV, k)\npars = Pars(data)\n\nposterior, pars = SampleSVD(data, pars; nits = 1000, burnin = 500, show_progress = true)\n\n\n\n\n\n","category":"method"},{"location":"examples.html#BayesianSVD.hpd-Tuple{Any}","page":"Examples","title":"BayesianSVD.hpd","text":"hpd(x; p=0.95)\n\nComputes the highest posterior density interval of x.\n\nArguments\n\nx: vector of data.\n\nOptional Arguments\n\np: value between 0 and 1 for the probability level.\n\nExamples\n\nx = [1, 3, 2, 5, .2, 1,9]\nhpd(x)\n\n\n\n\n\n","category":"method"},{"location":"index.html","page":"Home","title":"Home","text":"CurrentModule = BayesianSVD","category":"page"},{"location":"index.html#BayesianSVD","page":"Home","title":"BayesianSVD","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"Documentation for BayesianSVD.","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"","category":"page"},{"location":"index.html#Detailed-API","page":"Home","title":"Detailed API","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"Modules = [BayesianSVD]","category":"page"}]
